class Landing extends Component {
    render () {
        return (
              <Container>
                <Jumbotron>
                  <h2>Welcome to ASKIT website</h2>
                  <p>In our app you can ask about courses and get answers from friends, and sharing information about exams</p>
                </Jumbotron>
                <Link to ="/register">
                  <Button bsStyle="info"> Register Now</Button>
                </Link>           
              </Container>

        )
    }
}

export default Landing
